// ==UserScript==
// @name         每日监控
// @namespace    http://tampermonkey.net/
// @version      1.2
// @description  此脚本用于售后的每日监控
// @author       yaoriver
// @match        https://www.iylyx.com/HOSPITAL/*
// @icon         data:image/jpeg;base64,
// @grant        GM_addStyle
// @downloadURL https://update.greasyfork.org/scripts/520713/%E6%AF%8F%E6%97%A5%E7%9B%91%E6%8E%A7.user.js
// @updateURL https://update.greasyfork.org/scripts/520713/%E6%AF%8F%E6%97%A5%E7%9B%91%E6%8E%A7.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // 创建可拖拽的半透明框元素
    const dragBox = document.createElement('div');
    dragBox.style.position = 'absolute';
    dragBox.style.width = '200px';
    dragBox.style.height = '55px';
    dragBox.style.backgroundColor = 'rgba(0, 0, 0, 0.5)';
    dragBox.style.top = '50%';
    dragBox.style.left = '50%';
    dragBox.style.transform = 'translate(-50%, -50%)';
    dragBox.style.cursor = 'move';
    dragBox.draggable = true;

    // 创建确认按钮元素
    const confirmButton = document.createElement('button');
    confirmButton.textContent = '获取监控数据';
    confirmButton.style.marginTop = '10px';
    // 创建关闭按钮元素
    const closeButton = document.createElement('button');
    closeButton.textContent = '关闭';
    closeButton.style.marginTop = '10px';
    closeButton.addEventListener('click', function() {
        // 移除 dragBox 元素及其子元素
        dragBox.parentNode.removeChild(dragBox);
    });

    let timeOfDay;
    const currentDate = new Date();
    if (currentDate.getHours() < 12) {
        timeOfDay = '早';
    } else {
        timeOfDay = '晚';
    }
    confirmButton.addEventListener('click', function() {
        const tableRows = document.querySelectorAll('tr');
        let index = 0;
        const halfLength = Math.floor(tableRows.length / 2); // 计算 tableRows 长度的一半
        let wrappedLookHospitalNames = ''; // 存储拼接后的新变量
        let wrappedGetwayHospitalNames = '';
        tableRows.forEach(row => {
            if (index < halfLength) { // 仅处理前一半元素
                const lookAbnormalCell = row.querySelector('.el-table_1_column_9 span');
                const getwayAbnormalCell = row.querySelector('.el-table_1_column_8 span');
                
                const HospitalNameCell = row.querySelector('.el-table_1_column_2 div');
                if (lookAbnormalCell && lookAbnormalCell.textContent === '异常' && HospitalNameCell) {
                    // 将 lookHospitalName 的值用【】包裹并拼接
                    wrappedLookHospitalNames += `【${HospitalNameCell.textContent}】`;
                }
                if (getwayAbnormalCell && getwayAbnormalCell.textContent === '异常' && HospitalNameCell) {
                    wrappedGetwayHospitalNames += `【${HospitalNameCell.textContent}】`;
                }
                
                index++;
            }
        });
        let message = `今日${timeOfDay}班监测收费医院\n`;
        if (wrappedGetwayHospitalNames) {
            message += `getway异常：${wrappedGetwayHospitalNames}\n`;
        }
        message += `看图异常：${wrappedLookHospitalNames}\n`;
        message += `问题详情请相关人员查看如上截图@错过不再解释 @徐健 @ぃ @纵幻 @售后邱振天 `;
        console.log(message);
    });

    dragBox.appendChild(confirmButton);
    dragBox.appendChild(closeButton);
    document.body.appendChild(dragBox);

    // 实现拖拽功能的代码
    let offsetX, offsetY;
    dragBox.addEventListener('mousedown', function(e) {
        offsetX = e.clientX - dragBox.offsetLeft;
        offsetY = e.clientY - dragBox.offsetTop;
        document.addEventListener('mousemove', drag);
        document.addEventListener('mouseup', stopDrag);
    });

    function drag(e) {
        dragBox.style.left = (e.clientX - offsetX) + 'px';
        dragBox.style.top = (e.clientY - offsetY) + 'px';
    }

    function stopDrag() {
        document.removeEventListener('mousemove', drag);
        document.removeEventListener('mouseup', stopDrag);
    }

    // 使用GM_addStyle添加样式（用于解决可能的样式冲突等问题，这里简单设置一下按钮样式）
    GM_addStyle(`
        button {
            background-color: #4CAF50;
            border: none;
            color: white;
            padding: 5px 10px;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 20px;
            border-radius: 3px;
        }
    `);
})();